package com.example.redis.domain;import jakarta.persistence.*;import lombok.*;import org.springframework.data.redis.core.RedisHash;import java.io.Serializable;import java.util.ArrayList;import java.util.List;@Getter@Entity@Builder@NoArgsConstructor@AllArgsConstructorpublic class Item {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    @Setter    private String name;    @Setter    private String description;    @Setter    private Integer price;}